import{VectorField}from"/applets/vector-fields/scripts/class.min.js";import{createDesmosGraphs,desmosPurple,getDesmosSlider,setDesmosData}from"/scripts/src/desmos.min.js";import{$,raw}from"/scripts/src/main.min.js";export default function(){setDesmosData({vectorField:{bounds:{xmin:-8,xmax:8,ymin:-8,ymax:8},expressions:[{latex:raw`f_1(x, y) = x + 3y`,hidden:!0},{latex:raw`f_2(x, y) = 4x + 2y`,hidden:!0},...getDesmosSlider({expression:"n = 12",min:1,max:20,step:1,secret:!1}),...getDesmosSlider({expression:"s = 1",min:.5,max:2,secret:!1}),{latex:raw`A = [(a, b) \for a = [-n, -n+1, ..., n], b = [-n, -n+1, ..., n]]`,hidden:!0,secret:!0},{latex:raw`B = [(f_1(a, b), f_2(a, b)) \for a = [-n, -n+1, ..., n], b = [-n, -n+1, ..., n]]`,hidden:!0,secret:!0},{latex:raw`A + \frac{ts}{25}B`,color:desmosPurple,parametricDomain:{min:0,max:1},secret:!0},{latex:raw`S = [\arctan(f_2(a, b), f_1(a, b)) \for a = [-n, -n+1, ..., n], b = [-n, -n+1, ..., n]]`,hidden:!0,secret:!0},{latex:raw`M = [\left|(f_2(a, b), f_1(a, b))\right| \for a = [-n, -n+1, ..., n], b = [-n, -n+1, ..., n]]`,hidden:!0,secret:!0},{latex:raw`L = \frac{M}{50}`,hidden:!0,secret:!0},{latex:raw`T_1 = -(.35\cos(S + 0.5), .35\sin(S + 0.5))`,hidden:!0,secret:!0},{latex:raw`T_2 = -(.35\cos(S - 0.5), .35\sin(S - 0.5))`,hidden:!0,secret:!0},{latex:raw`A + \frac{s}{25}B + tsL(T_1)`,color:desmosPurple,parametricDomain:{min:0,max:1},secret:!0},{latex:raw`A + \frac{s}{25}B + tsL(T_2)`,color:desmosPurple,parametricDomain:{min:0,max:1},secret:!0}]},vectorField3d:{use3d:!0,bounds:{xmin:-2.5,xmax:2.5,ymin:-2.5,ymax:2.5,zmin:-2.5,zmax:2.5},expressions:[{latex:raw`f_1(x, y, z) = x + 3y`,hidden:!0},{latex:raw`f_2(x, y, z) = y^2 + z`,hidden:!0},{latex:raw`f_3(x, y, z) = x + z^2`,hidden:!0},...getDesmosSlider({expression:"n = 2",min:1,max:5,step:1,secret:!1}),...getDesmosSlider({expression:"s = 1.5",min:.5,max:2,secret:!1}),{latex:raw`A = [(a, b, c) \for a = [-n, -n+1, ..., n], b = [-n, -n+1, ..., n], c = [-n, -n+1, ..., n]]`,hidden:!0,secret:!0},{latex:raw`B = [(f_1(a, b, c), f_2(a, b, c), f_3(a, b, c)) \for a = [-n, -n+1, ..., n], b = [-n, -n+1, ..., n], c = [-n, -n+1, ..., n]]`,hidden:!0,secret:!0},{latex:raw`\vector(A, A + \frac{s}{25}B)`,color:desmosPurple,secret:!0}]}}),createDesmosGraphs();var e=$("#vectorField-canvas");const r=new VectorField({canvas:e});r.loadPromise.then(()=>{r.run({generatingCode:"((x + 3.0 * y) / 8.0, (4.0 * x + 2.0 * y) / 8.0)",worldWidth:5}),r.pauseWhenOffscreen()});e=$("#vectorField2-canvas");const n=new VectorField({canvas:e});n.loadPromise.then(()=>{n.run({generatingCode:"(x, -y)",dt:.002,worldWidth:3}),n.pauseWhenOffscreen()});e=$("#vectorField3-canvas");const a=new VectorField({canvas:e});a.loadPromise.then(()=>{a.run({generatingCode:"(-y, x)",dt:.002,worldWidth:3}),a.pauseWhenOffscreen()})}